import React, { Component } from "react";


class Rank extends Component {
  state = {
    platform: "psn",
    profile: "Lil_Kha1998",
    platformInfo:[],
    rankData: {},
  };
  
  onChange = () => {
    e
  }

  onSubmit = (e) =>{
    fetch(
        `http://localhost:5000/api/v1/rank/${this.state.platform}/${this.state.profile}`
      )
        .then((res) => res.json())
        .then((res) =>
          this.setState({
            rankData: res.data.data.platformInfo,
            platform: 'psn'
          })
        )
        .catch((err) => console.log(err));
     
   }

  render() {
    const { rankData} = this.state;
    console.log(rankData)
    return (
      <div className="rank-wrapper">
        <div className="rank-content">
    
        
          <h1>Rank</h1>
          <div className="ranked-output">
       <h2>{rankData.platformUserId}</h2>
       <img src={rankData.platformInfo.avatarUrl}></img>
          </div>
        </div>
     </div>
    );
  }
}

export default Rank;
